import React from "react";

import Navigation from "../components/Navigation";

const Accueil = () => {
  return (
    <div>
      <Navigation />
      <h1>Accueil</h1>

      <div>
        <h2>One pièce Card Game</h2>
        <p>
          Lorem ipsum dolor sit amet, consectetur adipisicing elit. Explicabo
          molestias officia qui vitae asperiores ratione magni quod nobis fugit
          distinctio. Veniam blanditiis tenetur inventore ut harum. Magni
          consequuntur dolorum esse sunt aliquam in, voluptatibus placeat alias
          laudantium molestiae pariatur distinctio.
        </p>
        <p>
          <a href="https://en.onepiece-cardgame.com/rules/" target="_blank">
            {"Régle du jeu en anglais "}
          </a>
        </p>
      </div>
    </div>
  );
};

export default Accueil;
